import path from 'path';

export default async function(page, fileUrl, screenshotsDir) {
  try {
    // Navigate to the HTML file
    await page.goto(fileUrl);
    await page.waitForLoadState('networkidle');

    // Take initial screenshot
    const screenshots = [];
    await page.screenshot({ path: path.join(screenshotsDir, 'step_1_initial.png') });
    screenshots.push(path.join(screenshotsDir, 'step_1_initial.png'));

    // Click the messages button in the navigation
    await page.waitForSelector('.messages-btn');
    await page.click('.messages-btn');

    // Wait for the messages modal to open
    await page.waitForSelector('#messagesModal');

    // Take a screenshot of the messages modal
    await page.screenshot({ path: path.join(screenshotsDir, 'step_2_messages_modal.png') });
    screenshots.push(path.join(screenshotsDir, 'step_2_messages_modal.png'));

    // Verify that the messages modal is visible
    const isModalVisible = await page.isVisible('#messagesModal');

    return {
      success: true,
      action: "Clicked messages button and verified messages modal opened",
      extractedData: { isModalVisible },
      screenshots,
      error: null
    };
  } catch (error) {
    return {
      success: false,
      action: "Failed to complete task",
      extractedData: {},
      screenshots: [],
      error: error.message
    };
  }
}

import path from 'path';

export default async function(page, fileUrl, screenshotsDir) {
  try {
    // Navigate to the HTML file
    await page.goto(fileUrl);
    await page.waitForLoadState('networkidle');

    // Take initial screenshot
    const screenshots = [];
    await page.screenshot({ path: path.join(screenshotsDir, 'step_1_initial.png') });
    screenshots.push(path.join(screenshotsDir, 'step_1_initial.png'));

    // Click on the messages button in navigation
    await page.waitForSelector('.messages-btn'); // Using class selector
    await page.click('.messages-btn');

    // Wait for messages modal to appear
    await page.waitForSelector('#messagesModal'); // Using ID selector
    await page.waitForTimeout(1000); // Optional wait for modal to fully render

    // Take screenshot of the messages modal
    await page.screenshot({ path: path.join(screenshotsDir, 'step_2_messages_modal.png') });
    screenshots.push(path.join(screenshotsDir, 'step_2_messages_modal.png'));

    // Verify messages modal is open by checking the header text
    const modalHeader = await page.$eval('#messagesModal h2', el => el.textContent);
    if (modalHeader !== "Messages") {
      throw new Error("Messages modal did not open correctly.");
    }

    return {
      success: true,
      action: "Clicked messages button and verified messages modal opened",
      extractedData: { modalHeader },
      screenshots,
      error: null
    };
  } catch (error) {
    return {
      success: false,
      action: "Failed to complete task",
      extractedData: {},
      screenshots: [],
      error: error.message
    };
  }
}

